tinsert(l,m(101,g({description="|cff66ccffOutland is the shattered floating remnants of the destroyed world of Draenor, the homeworld of the orcs and refuge of the draenei. After the sundering of Draenor, Outland was thrown partially towards the Twisting Nether, and is now in a constant state of degradation. It became the domain of the pitlord Magtheridon, who was eventually deposed and replaced by Illidan Stormrage until his death at the Black Temple.|r",icon="Interface\\Icons\\Achievement_Zone_Outland_01"},{m(105,g({description="|cff66ccffBlade's Edge is a level 65-70 questing zone in Outland, filled with splintered mountain peaks, plunging lush valleys, and dusty canyons. Players learn about the presence of the Burning Legion through a mysterious Fel Mask, as well as how Blade's Edge was the original home of the Ogres. Ogri'la is a faction of friendly ogres that players with flying mounts can gain reputation with.|r",lvl=65},{n(0,{i(23151,{requireSkill=755}),sp(27975,{itemID=22555,requireSkill=333}),sp(29643,{itemID=23612,crs={16952},coords={{72.8,40.6,105},{72.8,41.6,105},{73.6,38.4,105},{73.6,39.6,105},{73.6,43.6,105},{74.2,41.6,105}},requireSkill=164}),sp(28577,{itemID=22925,coords={{26.6,83.6,105},{28,82.2,105},{28.8,85.6,105},{29.8,77,105},{30.8,80.8,105}},requireSkill=171}),sp(27917,{itemID=22534,coords={{43.8,70.6,105},{45.6,79.4,105},{46,78,105},{46,80,105},{46.4,76.8,105},{46.6,74.8,105},{46.8,79.6,105},{47,76.6,105},{47.2,78,105}},requireSkill=333})})})),m(100,g({description="|cff66ccffHellfire Peninsula is intended to be the first questing zone players hit after passing through The Dark Portal, designed for level 58-62 characters. It is a scorched zone, the site of many former battles and the massacre of the Draenei. Players are introduced early on to the threat of the Burning Legion at The Legion Front, further learning about Magtheridon's creation of the corrupted Fel Orcs and the sacrifices made in past battles on Draenor. Players also begin to lear