tinsert(l,m(948,g({description="|cff66ccffThe Maelstrom is the gigantic rift that was created when the Well of Eternity collapsed into itself during the Great Sundering. Located in the middle of the Great Sea - which the Great Sundering created - the Maelstrom appears as a massive, fierce vortex of water.|r",icon="Interface\\Icons\\Achievement_Zone_Cataclysm"},{m(207,g({description="|cff66ccffDeepholm is one of the four regions of the Elemental Plane. It serves as both home and prison for the earth elementals, ruled by Therazane the Stonemother. Besides Therazane and her elementals, the Earthen Ring has also made Deepholm its temporary home. Stationed in the Temple of Earth, they are attempting to mend the wound Deathwing opened. In World of Warcraft: Cataclysm, Deepholm became accessible to players. It is the largest visitable level of the Elemental Plane, being a new questing, leveling and exploration zone tuned for level 82-83 players. It also holds a 5-man dungeon, the Stonecore. The two main enemy forces the player fight against are the Twilight's Hammer and a large tribe of stone troggs.|r",lvl=82},{n(-38,{prof(356,{o(202778,{i(22739,{c=a1})})})})}))})));
